  false,\n\t\"url\": null,\n\t\"notes\": \"Physical, meteorological, and other data
  were collected from XBT casts, buoys, and other instruments from a World-Wide distribution.
  Data were collected from 28 November 2002 to 02 January 2002. Data were submitted
  by the Marine Environmental Data Service (MEDS) in support of the Array for Real-time
  Geostrophic Oceanography (Argo), the Gulf of Mexico NOAA/NMFS Ship of Opportunity
  (SOOP), and the Global Temperature-Salinity Pilot Project (GTSPP). Physical parameters
  include profiles of temperature and salinity. Meteorological data include dry bulb
  temperature, wind speed, wind direction, relative humidity, and air pressure.\",\n\t\"owner_org\":
